import React, { Component } from 'react'

export default class SelectForm extends Component {
    render() {
        return (
            <div className="col-12">
                <div className="form-group form-group__config">
                    <select className="form-control" name id>
                        <option>LẬP TRÌNH DI ĐỘNG</option>
                        <option>LẬP TRÌNH FRONT-END</option>
                        <option>LẬP TRÌNH BACK-END</option>
                        <option>FULL STACK JAVASCRIPT</option>
                        <option>FULL STACK JAVA</option>
                    </select>
                </div>
            </div>
        )
    }
}
